package utils

import (
	"image"
	"io"
	"reflect"
	"testing"
)

func TestB64ToImage(t *testing.T) {
	type args struct {
		b64 string
	}
	tests := []struct {
		name    string
		args    args
		want    string
		wantErr bool
	}{
		{
			name:    "comlpete test",
			args:    args{b64: "data:image/jpeg;base64,"},
			want:    "image/jpg",
			wantErr: false,
		},
		{
			name:    "incorrect mime type",
			args:    args{b64: "data:image/gif;base64,"},
			want:    "",
			wantErr: true,
		},
		{
			name:    "incorrect mime type",
			args:    args{b64: "data:image/png;base64,"},
			want:    "",
			wantErr: true,
		},
		{
			name:    "no mime type",
			args:    args{b64: "data:;base64,"},
			want:    "",
			wantErr: true,
		},
		{
			name:    "comlpete png",
			args:    args{b64: "data:image/png;base64,"},
			want:    "image/png",
			wantErr: false,
		},
		{
			name:    "comlpete gif",
			args:    args{b64: "data:image/gif;base64,"},
			want:    "image/gif",
			wantErr: false,
		},
		{
			name:    "imcomplete gif",
			args:    args{b64: "data:image/gif;base64,"},
			want:    "",
			wantErr: true,
		},
		{
			name:    "empty b64 string",
			args:    args{b64: ""},
			want:    "",
			wantErr: true,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, got1, err := B64ToImage(tt.args.b64)
			if (err != nil) != tt.wantErr {
				t.Errorf("B64ToImage() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if got != tt.want {
				t.Errorf("B64ToImage() got = %v, want %v", got, tt.want)
				return
			}

			if tt.wantErr {
				return
			}

			_, ok := got1.(image.Image)
			if !ok {
				t.Errorf("B64ToImage() error = %v, want %v", reflect.TypeOf(got1), image.RGBA{})
			}
		})
	}
}

func TestImageToTypedImage(t *testing.T) {
	type args struct {
		mime string
		img  image.Image
	}
	tests := []struct {
		name    string
		args    args
		want    io.Reader
		wantErr bool
	}{
		// TODO: Add test cases.
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			got, err := ImageToTypedImage(tt.args.mime, tt.args.img)
			if (err != nil) != tt.wantErr {
				t.Errorf("ImageToTypedImage() error = %v, wantErr %v", err, tt.wantErr)
				return
			}
			if !reflect.DeepEqual(got, tt.want) {
				t.Errorf("ImageToTypedImage() = %v, want %v", got, tt.want)
			}
		})
	}
}
